- Inclusion: All Versions, All Changelogs, Upgrading Versions

Add AnimatedStyles library

Adding library which simplifies animating a `View`, `Image`, `Text` component between two styles, depending on the parent's state.  A good example of this is text that is red during an error, or a child view that moves or changes sizes/rotation depending on the state of the parent.

Before:
```
<Animated.View
style={{
  width: 100,
  height: 100,
  opacity: animationValue.interpolate({
    inputRange: [0, 1],
    outputRange: [0, 1]
  }},
  transform: [
    {rotate: animationValue.interpolate({
      inputRange: [0, 1],
      outputRange: ['0deg', '90deg']
    }}
  ]
}}
```

After:
```
<AnimatedStyles.View
style={{
  width: 100,
  height: 100,
  opacity: 0
}}
animatedStyle={{
  opacity: 1,
  transform: [{ rotate: '90deg' }]
}}
active={this.state.active}
/>
```
